import React from "react";
import ReactDOM from "react-dom";

import "./index.css";
import App from "./App";
import { AudioContextProvider } from "./components/Context/auth-context";

ReactDOM.render(
  <AudioContextProvider>
    <App />
  </AudioContextProvider>,
  document.getElementById("root")
);
